/** @param {GraphicContext} gc */
 async function vizRep(gc) {
await gc.setVariable('width', await gc.expression.attrvalByName('Width Aggregation'), false);
await gc.setVariable('height', await gc.expression.attrvalByName('Height Aggregation'), false);
let width = parseFloat(await gc.getVariableValue('width'))||3;
let height = parseFloat(await gc.getVariableValue('height'))||5;
await gc.graphic_cube(width+0.02,height+0.02,0.001,'black',undefined,0,0,-0.1);
await gc.graphic_cube(width, height,0.002, 'lightgrey',undefined,0,0,-0.1);
await gc.setVariable('name', await gc.expression.attrvalByName('Name'), false); await gc.setVariable('x_rel',-width/2+0.5, true); await gc.setVariable('y_rel', height/2+0.2, true); await gc.setVariable('z_rel', 0.05, true); await gc.graphic_text(await gc.getVariableValue('x_rel'), await gc.getVariableValue('y_rel'), await gc.getVariableValue('z_rel'), 0.2, 'black',await gc.getVariableValue('name'), 'x_rel', 'y_rel', 'z_rel');
let icon='data:image/png;base64,';
}

